d anti-shield system etc are also included.<br></br>Powerful size, accompanied by expressive saber effect.<br></br>A figure of 1/100 Raul Kruse is also included.<br></br><br></br>- accessories<br></br>· Eudydium · Beam rifle × 1<br></br>· Multiple troop shield system × 1<br></br>· Dragoon Injection Reproduction Post × 5<br></br>· Hand grip (right and left) × 1 each<br></br>· Hirate (left and right) × 1 each<br></br>· Gun handle (right) × 1<br></br>· Holed hand grip (right and left) × 1 each<br></br>· Saber effect × 1<br></br>· Zaft mark pedestal × 1<br></br><br></br></div>','crawlpending','2018-10-30 01:50:34','d9e4f50fe26a7e88d85fb166252ee45a',0,0),(2086,'2412427','PLAN303E Deep Striker',15,21,10,'18,000 yen','Mid Mar., 2018','\n<div>This item is limited to 3 per household.<br></br>Copyright Sotsu / Sunrize</div>\n<div><br></br>- MG (master grade) Series 200 achievement commemoration! A large item [PLAN 303 E Deep Striker] has appeared from [Gundam sentinel] celebrating 30th anniversary!<br></br><br></br>- Faithfully reproduce the structure of the Deep Striker, which was regarded as a hopeless modeling at the time due to its complexity and enormity.<br></br>- In addition to the characteristic large mega particle cannon, disk and radome, increased armor, etc., S Self-Repairing Gundam itself is partly newly shaped to become three-dimensional.<br></br><br></br>- Reproduction of large armament as set up<br></br>The mega particle cannon is modeled with a crimp size of about 540 mm. In addition to precisely reproducing fine shapes such as large disks and radomes, multi-sensors, etc., the large booster of the leg added a mechanism that can be expanded to eight letters, new construction. It reproduces a unique silhouette.<br></br><br></br>- Reality based on different materials<br></br>Mesh pipe is used for the cable connecting mega particle cannon and tail stabilizer. Plating processing is applied to the cylinder parts of various parts of the aircraft, and [heavy feeling] 