,'2228590','MBF-02+EW454F Strike Rouge Otori Equipment Ver.RM',15,21,10,'3,780 yen','Late Sep., 2013','\n<div>This item is limited to 3 per household.<br></br>Copyright Sotsu Agency / Sunrize<br></br><br></br><i>Note: Can only fit one copy per SAL Small Packet/Registered SAL shipment,<br></br> and size limitations may be exceeded if combined with other items.</i></div>\n<div><br></br>- Announced along with the release of the Mobile Suit Gundam SEED Destiny HD Remaster\'s Ootori Striker, this marks the fastest a Suit has been translated into an MG in Gundam history! <br></br>- Following in the footsteps of the Aile Strike Gundam, the Strike Rogue is remastered (Ver.RM), giving the kit a more streamlined look and wide range of motion. Introduced in the HD Remaster of M.S.G.: SEED Destiny, the Ootori Striker Pack was designed by master mechanical designer Kunio Okawara. An Integrated Weapon Striker Pack, the Ootori is full of gimmicks<br></br>Following the Aile Strike Gundam, MG Strike of Rouge becomes a Ver.RM.<br></br>- Ootori Striker Pack wings expand into a characteristic “X” shape, and tail can be folded. <br></br>- Missile Launcher is mounted over the left shoulder.<br></br>- Dedicated Stand to help reenact arial action poses is included.<br></br>- IWSP EW454F Ootori Pack is separable from the Strike Rogue, and includes a transformation gimmick to shift into flight mode. <br></br>- The MBF-02 Strike Rouge has been equipped with the IWSP (Integrated Weapon Strike Pack) Ootori Striker for maximum offensive output! Designed with an aerodynamic profile, advanced propulsion system and a full arsenal- Railgun, Beam Launcher, Missile Pod and Anti-Ship Sword. <br></br><br></br>- Accessories: 57mm High-Energy Beam Rifle, Anti-Beam Shield, Armor Schneider x2, Beam  Saber x2, Ootori Striker Pack, Dedicated Stand</div>\n<div>Item Size/Weight : 39.1 x 31.1 x 9.5 cm / 883g</div>\n</div>','crawlpending','2018-10-30 01:54:21','88ca8ea0d2516faa210016d16c2f6ab3',0,0),(2127,'221034