lexibility in the arm joints.<br></br>・ Rear leg armor enables better range of motion in the ankle joints. <br></br>・ Includes paintable material for the internal structure for easy detailing.<br></br><br></br>- Accessories: Beam Saber x2, Beam Rifle, Shield, Hyper Bazooka</div>\n<div>Item Size/Weight : 39.2 x 31.2 x 8.5 cm / 788g</div>\n</div>','crawlpending','2018-10-30 01:54:26','cc8fb07d5203c5795a3a6696da2d6ef6',0,0),(2128,'2204931','AMS-119 Geara Doga',15,21,10,'4,320 yen','Mid Jul., 2013','\n<div>This item is limited to 3 per household.<br></br>Copyright Sotsu Agency / Sunrize<br></br><br></br><i>Note: Can only fit one copy per SAL Small Packet/Registered SAL shipment,<br></br> and size limitations may be exceeded if combined with other items.</i></div>\n<div><br></br>- From Mobile Suit Gundam: Char\'s Counterattack comes the flagship MS or the second Neo Zeon War: The Geara Doga! <br></br>- Successor to Zeon\'s ubiquitous Zaku series, the Geara Doga is reproduced as a detail-oriented Master Grade kit. Utilizing the most current MG technology, the kit has a high degree of mobility given its size, movable mono-eye, and uses varying materials to replicate different elements of the suit, such as the power piping. <br></br>- One of the most massive MGs- incredibly wide, and almost 8” tall! <br></br>- Head crest can be swapped out for a Command-type Suit or Grunt-type Suit. <br></br>- Power piping, such as at the shin and joints, is reproduced in a soft material for easy assembly. <br></br>- Mono Eye is movable from side to side, and head can be equipped with a Gundam LED (sold separately)<br></br><br></br>- Accessories: Shield, Sturm Faust x4, Beam Machine Gun (2 Types),<br></br>Beam Saber, Beam Effects (3 Types), Beam Axe</div>\n<div>Item Size/Weight : 39 x 31.3 x 9.5 cm / 904g</div>\n</div>','crawlpending','2018-10-30 01:54:31','e183595f5b5bddaace6014cd6aae6fb6',0,0),(2129,'2211560','Gundam AGE-2 Double Bullet',15,21,10,'3,780 yen','Mid Jun., 2013','\n<div>Copyr