ers, hyper bazooka, and shield, this Suit was the star of the original Mobile Suit: Gundam. Setting the trend for all Master Grades, this kit is molded in colors accurate to the version you know, and features details such as a 1/100 seated scale figure of the pilot and decals to customize your kit. A classic unit, this kit belongs on the shelf of any true collector.</div>\n<div>Item Size/Weight : 31.5 x 20.3 x 8.5 cm / 479g</div>\n</div>','crawlpending','2018-10-30 02:11:33','a0e3ed4b62d2ce18034a8c049716f77b',0,0),(2325,'0070949','RX-78NT1 Gundam NT-1',15,21,10,'2,700 yen',NULL,'\n<div>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>The primary suit of Gundam 080: War in the Pocket, the NT-1, or ‘Alex,’ this kit includes a beam rifle, dual beam sabers, the arm gatling, a shield, and can be modified with the Chobham armor system, giving the suit significant heft and protection. As with all Master Grades, this kit is molded in colors accurate to the version you know, and features details such as a 1/100 seated scale figure of the pilot and decals to customize your kit.</div>\n<div>Item Size/Weight : 31 x 20 x 10 cm / 612g</div>\n</div>','crawlpending','2018-10-30 02:11:37','0a5fc85358460c620d90f84ef6e55146',0,0),(2326,'0074897','RX-78 GP02A GUNDAM GP02 PHYSALIS (Coating Ver.)',15,21,10,'5,400 yen',NULL,'\n<div>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>Built as the second of the four Suits created under the Gundam Development Project, the GP02 is best remembered as Zeon ace Anavel Gato’s primary suit in Gundam 083. Armed with an atomic bazooka, beam saber, and protected by a massive shield, this Master Grade kit is molded in colors accurate to the version you know, and features details such as a 1/100 and 1/20 scale figure of pilot Anavel Gato, and decals to customize your kit.<br></br><br></br>This version is molded with a chrome coating to make this already threatening suit truly stand out.</div>\n<div></div>\n\n</div>\n\n</div>\n\n<div></div>\n<hr></hr>\n\n<div>\n    <div></div>\n    </div>','crawlpending','2018-10-30 02:11:40','ef1414d9c2d3a4633f5ca39ea4d9ae33',0,0),(2327,'0074440','MS-09R Rick Dom',15,21,10,'3,600 yen',NULL,'\n<div>This item is limited to 3 per household.<br></br>Copyright Sotsu Agency / Sunrize<br></br>See <A>MS-09 Dom (MG) (Gundam Model Kits)</A> also.<br></br>See <A>MS-09 Dom / MS-09R Rick-Dom (HGUC) (Gundam Model Kits)</A> also.<br></br><i>Note: Can only fit one copy per SAL Small Packet/Registered SAL shipment,<br></br> and size limitations may be exceeded if combined with other items.</i><br></br>See <A>Gundam Decal (MG) for MS-09 Dom/MS-09R Rickdom (Gundam Model Kits)</A> also.</div>\n<div><br></br>Built from the popular Zeon Dom Suit, the Rick Dom was optimized for space combat to combat the growing presence of the Federation in the Sides. Armed with a beam bazooka, integral scattering beam gun, and heat sword, the Rick Dom outpaces most standard Feddie Suits with it’s extra boosters. As with all Master Grades, this kit is molded in colors accurate to the version you know, and features details such as a 1/100 seated scale figure of the pilot and decals to customize your kit.</div>\n<div>Weight : 806g</div>\n</div>','crawlpending','2018-10-30 02:11:42','2b167a303d1e458fccdfe673d26a6dce',0,0),(2328,'0071691','RGM-79N GM Custom',15,21,10,'2,700 yen',NULL,'\n<div>This item is limited to 3 per household.<br></br>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>Held back by high production and operating costs, the GM Custom was nonetheless a commanding presence on the battlefield! While only armed with a beam rifle, kinetic rifle, beam saber, and shield like most GMs, this unit rivals the performance of seemingly more advanced Gundam-type Suits. As with all Master Grades, this kit features details such as a 1/100 seated scale figure of the pilot, a 1/20 scale figure of pilot South Burning, and decals to customize your kit.</div>\n<div>Item Size/Weight : 31 x 20 x 10 cm / 612g</div>\n</div>','crawlpending','2018-10-30 02:11:45','471a0229e69fc84b6a824b371ecaadef',0,0),(2329,'0071692','RGM-79Q GM Quel',15,21,10,'2,700 yen',NULL,'\n<div>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>The first mass-produced Mobile Suit utilized by the (initially) anti-Zeon forces, the Titans, is realized as a Master Grade! Armed with a beam rifle, kinetic rifle, shield, and beam saber, the Quel is a force to be reckoned with. As with most Master Grades, this kit features details such as a 1/100 scale figure of the pilot, a 1/20 scale figure of engineer Nina Purpleton, and stick-on decals.</div>\n<div>Item Size/Weight : 31 x 20 x 10 cm / 533g</div>\n</div>','crawlpending','2018-10-30 02:11:47','acca980e8e17cfa2e35b78ef1fd4b75a',0,0),(2330,'0071690','MSZ-010 ZZ Gundam',15,21,10,'3,600 yen',NULL,'\n<div>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>The titular Mobile Suit of anime Mobile Suit Gundam: ZZ, the ZZ Gundam, or Double Zeta, boasts a huge arsenal of weaponry ranging from its dual beam sabers and double beam rifle to its high mega cannon nested in the head unit. An early variable MS, the ZZ can shift into the powerful G-Fortress Armor, or split into the smaller core base and core top. As with most Master Grades, this kit features details such as a 1/100 scale figure of pilot Judau Ashta and stick-on decals. One of the classic MGs, the ZZ Gundam belongs on the shelf of any Gundam fan!</div>\n<div>Weight : 806g</div>\n</div>','crawlpending','2018-10-30 02:11:50','1da53e987d074d4f28bdfa631fd5aa0f',0,0),(2331,'2403828','RX-0 Unicorn Gundam',16,22,12,'3,420 yen',NULL,'- GUNPLA EVOLUTION PROJECT 2nd volume !!\n- Unicorn Gundam is awake now, with a form pursuing reality and transformation gimmicks reproduced at 1/144!\n- Unicorn Gundam is made into RG with a mechanism based on original setting consideration and real detail. [Transform] is realized for the first time on 1/144 scale by [Advanced MS Framework].\n\n[EVOLUTION POINT `TRANSFORMATION (transformation)`]\n- Create a product that will become Gundam\'s next-generation standard [GUNPLA EVOLUTION PROJECT]. EVOLUTION POINT in the second project [RG 1/144 Unicorn Gundam] is `TRANSFORMATION`. Realized transformation beyond the limit within the constraints of 1/144 scale.\n\n[ADVANCED MS FRAMEWORK]\n- A new framework developed to embody the Unicorn Gundam as RG. By \"Advanced MS Framework\" equipped with three gimmicks, [Advanced MS Joint], [Lock Mechanism], [Link Mechanism], we realize high stability after assembly and compatibility of movement of each part.\n\n- 01: New frame pursuing a transformation mechanism [Advanced MS joint]\nI thoroughly examined the transformation to the destroy mode, and created a new frame. It is the new design pursuing the transformation mechanism, [Advance MS joint] which is responsible for its center.\n\n- 02: Precise locking mechanism to lock parts when transforming [lock mechanism]\nBesides the armored part of the external forearm, locking mechanism for fixing parts after transformation is installed in various places. Realize high stability after transformation.\n\n- 03: RG original proprietary [link mechanism] to reproduce a smooth transformation\nThe characteristic leg leg transformation of Unicorn Gundam is reproduced with a new [link mechanism]. This mechanism enables smooth transformation while alleviating the assembly process.\n\n- Precise reproduction of weapon deployment. In addition to deployment of the psycho-frame of the shield, the cartridge detaching mechanism of beam · magnum is reproduced.\n\n- Accessories: Beam · Magnum × 1, Beam · Saber × 2, Hyper · Bazooka × 1, Shield × 1\n\n( This is a machine translation. Please allow for possible misinterpretations in the text. )\n\nItem Size/Weight : 31 x 19 x 8.2 cm / 511g','Available','2018-10-31 01:45:57','017147a5c6623b7cfcb49603cd946664',0,0),(2332,'2103482','Strike Freedom Gundam',17,23,10,'22,500 yen','Early Dec., 2010','\n<div>This item is limited to 1 per household.<br></br>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>- Designed by master artist Hajime Katoki, this is the ultimate version of the Strike Freedom Gundam! <br></br><br></br>- The largest PG kit so far, the Strike Freedom’s massive wings expand to activate HiMAT Mode, giving the suit a silhouette that dwarfs all other previous PG kits!<br></br>- Custom Display Stand included! Display Stand gives you the freedom to display your model in whatever dynamic poses you choose! <br></br>-  Extra Finish Inner Frame!<br></br>Inner Frame pieces moulded with Extra Finish, giving it a golden shine and drawing attention to it during HiMAT and Full Burst Mode! <br></br>- Full Burst Mode Extension  Gimmick<br></br>  By sliding out the Super DRAGOON weapons, each part linked to it is expanded into firing mode.<br></br>- Redesigned Mobile Inner Frame!<br></br>  Golden Inner Frame is exposed when manipulating the joints. Exterior armor is designed with a sliding gimmick which, in conjunction with an inner frame evolved from the PG Strike Gundam, gives this kit a dynamic frame effect.<br></br>- New, stronger joint mechanism!<br></br> Weight Bearing parts such as the hips and legs have been redesigned with a new mechanism. with this updated joint system, you’ll have no problem creating whatever poses come to mind!<br></br><br></br>- Accessories: Beam Shield, Beam Rifle x2, Beam Saber x2, Xiphias 3 Rail Cannon x2,<br></br>  DRAGOON Wing Parts x8, Custom Display Base<br></br>*Requires 2x LR41 batteries for LED, batteries sold separately.</div>\n<div>Item Size/Weight : 59.5 x 40 x 17.3 cm / 3360g</div>\n</div>','crawlpending','2018-10-31 23:29:10','e11476778c5af1b1469ee909ded30633',0,0),(2333,'2303444','RX-0 [N] Unicorn Gundam 02 Banshee Norn',17,23,10,'19,800 yen','Late Sep., 2015','\n<div>This item is limited to 1 per household.<br></br>Copyright Sotsu Agency / Sunrize</div>\n<div><br></br>- [Kuroki lion] final battle form of Banshi~i - Banshi~i-Norns appeared !! to PG<br></br><br></br>- [Mobile Suit Gundam UC] than Banshi~i-Norns appeared become a Gundam highest grade PG. Fully reproduce the transformation from Unicorn mode to Destroy mode. Various equipment comes as the final decisive battle form.<br></br><br></br>- Armed Armor DE as a new accessory armed, comes with parts to reproduce the revolving launcher (. Existing beam Magnum, new parts added to shield both form reproducible).<br></br>- Psycho frame that is exposed to Destroy mode UV emission resin made of clear plastic reproduced in (clear yellow) specification.<br></br>- Anime by removing the Armed armor XC version Banshi~i also reproducible.<br></br><br></br>- Accessories: Beam Magnum (revolving launcher), shield (Armed armor DE), Armed armor XC, beam Jytte effect, beam saber × 2, beam Magnum spare magazine, pilot figures (Standing-sitting)<br></br><br></br></div>','crawlpending','2018-10-31 23:40:12','ac4c88bcc79b1de83dbbb4c380a4bb79',0,0);
