INSERT INTO `modelrating` VALUES (5,2135,1,5,'While I understand that the point of a review is to inform, I am honestly disappointed in the ones posted by my peers. Most of the reviews are either blindly positive or blindly negative.','2018-11-05 03:55:09'),(6,2135,16,4,'It saddened me to see the number of people panning this excellent series on this site. Gundam wing, for me, was possibly one of the best anime\'s I have ever see, and YES I have seen the original series.','2018-11-05 04:00:17'),(7,2135,17,5,'GW\'s charm lies not in it\'s battles, but in the evolution of it\'s characters. sure, fanboy-puritans could aruge that they are merely vacuous pretty-boys.','2018-11-05 04:01:27'),(8,2135,18,5,'This was one of the first anime\'s I ever saw...I remember staying up late to watch it unedited on Cartoon Network.','2018-11-05 04:03:18'),(9,2135,19,4,'The Earth Sphere alliance is lead by Treize Kushrenada and the mysterious Zechs Marquise, who wears a mask almost constantly.','2018-11-05 04:04:28'),(10,2135,20,5,'This is a great anime and in my opinion the best in the saga. The anime has extremely well developed characters with several problems and inner demons. The plot is also great. The animation is smart and the dialog witty.','2018-11-05 04:07:12'),(11,2135,21,4,'Gundam Wing is the first installment of the 20 year old Mobile Suit Gundam franchise to make it to american television. And quite frankly, I think that Cartoon Network could have chosen a better introduction.','2018-11-05 04:07:52'),(12,2135,22,5,'I have just recently purchased collection one of this awesome series and even after just watching three episodes, I still am mesmerized by sleek styling of the animation and the slow, yet thoughtful actions of the story-telling.','2018-11-05 04:08:36'),(13,2135,23,5,'Pros: Deep story, awesome characters, smooth animation Cons: Series final episodes feel a little rushed, need more Gundams!','2018-11-05 04:12:34'),(14,2135,24,5,'Gundam Wing isn\'t the deepest or most meaningful anime in existence. But it\'s not necessarily DragonBall Z either. Compared to the Universal Century Gundam chapters, though, Gundam W seems a bit on the shallow side.','2018-11-05 04:13:00'),(15,2135,25,4,'The mecha designs (namely the Deathscythe) are somewhat interesting, but I prefer the more utilitarian designs of the UC. The best mecha are found in the Endless Waltz OVA, however. Luckily there\'s no Turn-A in this series.','2018-11-05 04:13:28'),(16,2135,26,5,'If you want thought-provoking anime, look for a UC Gundam or get Evangelion or Lain. If you want a shallow \"story\" and fights that last 10 episodes, get Dragonball Z. If you want a balance of the two, Gundam W might fit the bill.','2018-11-05 04:21:21'),(17,2135,27,4,'I absolutely love this show so much. If there\'s a real Gundam Wing movie someday I will go to see it definetly and I will know the movie will be the best.','2018-11-05 04:21:54'),(18,2135,28,5,'Well, Gundam Wing is the best Gundam series I\'ve ever seen, because the gundams are a lot better than the gundams from Mobile Suit Gundam. The characters are really cool. ','2018-11-05 04:23:19'),(19,2135,29,5,'If your going to watch Gundam, watch Universial Century Gundam, or some of the better AU series like Gundam X and Turn-A Gundam.','2018-11-05 04:24:24');
